import './footer.css'

const footer=(props)=>{
    return (
        <div>
            <footer className="footer is-primary">
                <div className="container">
                    <div className="columns">
                        <div className="column">
                            <p>Its a footer you can place stuff here</p>
                        </div>
                        <div className="column has-text-right">
                            <a clasName="icon" href="/"><i className="fa fa-facebook"></i></a>
                            <a clasName="icon" href="/"><i className="fa fa-twitter"></i></a>
                        </div>
                    </div>
                </div>
            </footer>
        </div>
    )
};

export default footer;
